// import { getRequest, getRequestByQuery } from "../module/http.module";
import { CreateToken } from "../module/token.module";
import axios from "axios";

export const Register = async (req, res) => {
  // res.status(200).json({ message: "success", data: req.body });
  try {
    const registerRes = await axios({
      method: "post",
      url: `${process.env.ENDPOINT}/user`,
      data: req.body,
    });
    console.log("register", registerRes.data);
    res.status(registerRes.status).json(registerRes.data);
  } catch (err) {
    res.status(err.response.status).json(err.response.data);
  }
};

export const Login = async (req, res) => {
  try {
    if (req.session.data.isLogged) {
      const userToken = await CreateToken(
        `${process.env.ENDPOINT}/auth/login`,
        req.session.data
      );
      res.cookie("authToken", userToken, {
        maxAge: 86400000,
        // domain: "localhost:3000",
        secure: true,
        httpOnly: true,
      });
      res.status(200).json({
        isLogged: true,
        token: userToken,
        message: "Password is correct!",
      });
    } else {
      res.json(userRes.body);
    }
  } catch (error) {
    res.status(500).json({ message: "Internal server error" });
  }
};

export const ForgotPassword = async (req, res) => {
  try {
    const data = req;
    const expiresIn = 120;
    const token = await createCustomToken(data, expiresIn);
    const userRes = await getRequestByQuery({
      endpoint: process.env.ENDPOINT,
      api: "/user",
      data: token,
    });
    console.log(userRes.body);
    res.status(userRes.statusCode).json(userRes.body);
  } catch (error) {
    res.status(500).json({ message: "Internal server error" });
  }
};
export const ResetPassword = async (req, res) => {
  try {
    const data = req.body;
    const code = data.varification_code;
    const password = data.new_password;
    const updatedRes = await axios.put(`${process.env.ENDPOINT}/user/${code}`, {
      data: password,
    });
    res.status(updatedRes.status).json(updatedRes.data);

    //  FOR LINK SHERING
    // const token = req.query.token;
    // const password = req.body.password;
    // if (password) {
    //   const updatedRes = await axios.put(
    //     `${process.env.ENDPOINT}/user/${token}`,
    //     { data: password }
    //   );
    //   res.status(updatedRes.status).json(updatedRes);
    // } else {
    //   res.status(424).json({ message: "Please enter your password !" });
    // }
  } catch (error) {
    res.status(500).json({ message: "Internal server error" });
  }
};

