import express from "express";
import {
  Get,
  GetById,
  Post,
  Update,
  Delete,
  Patch,
} from "../controller/user.controller.js";

const router = express.Router();
router.get("/", Get);
router.get("/:id", GetById);
router.post("/", Post);
router.put("/:id", Update);
router.patch("/:id", Patch);
router.delete("/:id", Delete);

export default router;

