import User from "../schema/user.schema.js";
// import { VerifyToken } from "../module/token.module";
// import { verifyMail } from "../module/mail.module";
// import { decrypt, encrypt } from "../module/bcrypt.module";
// import Randomstring from "randomstring";

export const Get = async (req, res) => {
  try {
    const { token } = req.query;
    const data = await VerifyToken(token);
    if (data) {
      const query = {
        email: data.email,
      };
      const user = await User.find(query);
      if (user.length) {
        const typedPass = data.password;
        const userPass = user[0].password;
        const isPasswordMatch = await decrypt(userPass, typedPass);
        if (isPasswordMatch) {
          res.status(200).json({
            isLogged: true,
            data: user[0],
            message: "Password is Correct !",
          });
        } else {
          res.status(401).json({
            isLogged: false,
            message: "Password is Incorrect !",
          });
        }
      } else {
        res.status(404).json({
          isUserExists: false,
          message: "Email Not Found !",
        });
      }
    }
  } catch (err) {
    res.status(500).json({ message: "Internal server error" });
  }
};

export const GetById = async (req, res) => {
  // try {
  //   const userId = req.params.id;
  //   console.log(userId);
  //   // Fetch the user with the provided ID and populate the 'cart' field to get cart details
  //   const user = await User.findById(userId).populate("cart");
  //   console.log(user);
  //   res.status(200).json(user);
  // } catch (error) {
  //   res.status(500).json({ error: "Failed to fetch user details." });
  // }

  // FORGOT PASSWORD CODE
  try {
    const code = generateRandomCode();
    const token = await verifyToken(req);
    console.log(token);
    if (token.isVerified) {
      const query = {
        email: token.data.email,
      };
      const userRes = await User.findOne(query);
      if (userRes) {
        await User.updateOne(query, {
          $set: { varificationCode: code },
        });
        try {
          await verifyMail(query.email, code);
          res.status(200).json({
            success: true,
            message: "Please check your Gmail and reset your password !",
          });
        } catch (error) {
          console.error("Error sending mail:", error);
          res.status(500).json({ message: "Error sending mail" });
        }
      } else {
        res.status(500).json({ message: "Internal Server Error" });
      }
    } else {
      res.status(401).json({ message: "Permission denied" });
    }
  } catch (err) {
    res.status(500).json({ message: "Internal server error" });
  }
};

export const Post = async (req, res) => {
  console.log(req.body);
  // try {
  //   const userData = req.body;
  //   console.log("user:", userData);
  //   const newUser = new User(userData);
  //   const userRes = await newUser.save();
  //   res.status(200).json({
  //     isUserCreated: true,
