  //   });
  // } catch (error) {
  //   res.status(409).json({
  //     isUserCreated: false,
  //     message: error.message,
  //   });
  // }
};

export const Update = async (req, res) => {
  try {
    const code = req.params.id;
    const newPassword = req.body.data;
    const query = {
      varificationCode: code,
    };
    const verifyCode = await User.findOne(query);
    if (verifyCode) {
      const newPassEncpt = await encrypt(newPassword);
      const query = {
        id: verifyCode.id,
        newPass: newPassEncpt,
      };
      const updatedRes = await User.findByIdAndUpdate(
        { _id: query.id },
        { $set: { password: query.newPass, varificationCode: "" } },
        {
          new: true,
        }
      );
      res.status(200).json({
        succes: true,
        message: "Your Password is updated !",
        data: updatedRes,
      });
    } else {
      res
        .status(424)
        .json({ success: false, message: "varificaion code is wrong !" });
    }
  } catch (err) {
    res.status(500).json({ message: "Internal server error !" });
  }

  //LINK SHARING
  // const token = req.params.id;
  // const query = {
  //   token,
  // };
  // const tokenRes = await User.findOne(query);
  // if (tokenRes) {
  //   const password = req.body.data;
  //   const newPass = await encrypt(password);
  //   const query = {
  //     id: tokenRes.id,
  //     newPass: newPass,
  //   };
  //   const updatedRes = await User.findByIdAndUpdate(
  //     { _id: query.id },
  //     { $set: { password: query.newPass, token: "" } },
  //     {
  //       new: true,
  //     }
  //   );

  //   res.status(200).json({
  //     succes: true,
  //     message: "Your Password is updated !",
  //     data: updatedRes,
  //   });
  // } else {
  //   res
  //     .status(424)
  //     .json({ succes: false, message: "This link has been expired !" });
  // }
};

export const Delete = async (req, res) => {
  res.status(200).json({ message: "delete a user" });
};

export const Patch = async (req, res) => {
  try {
    const userId = req.params.id;
    const tokenData = req.body.token;
    const data = {
      body: {
        token: tokenData,
      },
    };
    const tokenRes = await verifyToken(data);

    if (tokenRes.isVerified) {
      const cartId = tokenRes.data.cart._id;
      const updatedUser = await User.findByIdAndUpdate(
        userId,
        { $push: { cart: cartId } },
        { new: true }
      );
      return res.status(200).json({
        success: true,
        message: "Product added to cart successfully",
        data: updatedUser,
      });
    }
    res.status(424).json({ success: false, message: "Something is wrong !" });
  } catch (err) {
    res.status(500).json({
      message: "Internal server error",
      // err
    });
  }
};

const generateRandomCode = () => {
  const min = 1000; // Minimum 4-digit number
  const max = 9999; // Maximum 4-digit number
  return Math.floor(Math.random() * (max - min + 1)) + min;
};

